package collection;

public class Book {
	public String id;
	public String name;
	public Book() {
		// TODO Auto-generated constructor stub
	}
	public Book(String id, String name) {
		super();
		this.id = id;
		this.name = name;
	}
	
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
}